import App from './App';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';


function Routing() {
    return (
 <div>
    <div className="Nav">
            <div className="inner">
                <Link to="/">Home</Link>
                <Link to="../Login">Home &gt; Login</Link>
                <Link to="../Mypage">Home &gt; Mypage</Link>
                <Link to="../Qna">Home &gt; Qna</Link>
                <Link to="../Store">Home &gt; Store</Link>
            </div>
        </div>
 </div>

    );
}

export default Routing;
